issue.body:
Is there a way to perform requests resulting in json responses without including request/response info in comments in the results buffer?

That is, a way to not show responses like this:

```json
{
  "tagline": "You Know, for Search",
  "version": {
    "lucene_version": "4.10.4",
    "build_snapshot": false,
    "build_timestamp": "2015-07-29T09:54:16Z",
    "build_hash": "b88f43fc40b0bcd7f173a1f9ee2e97816de80b19",
    "number": "1.7.1"
  },
  "cluster_name": "es",
  "name": "Bill Foster",
  "status": 200
}
// GET http://127.0.0.1:9200/
// HTTP/1.1 200 OK
// Content-Type: application/json; charset=UTF-8
// Content-Length: 333
// Request duration: 0.023388s
```

But rather like this:

```json
{
  "tagline": "You Know, for Search",
  "version": {
    "lucene_version": "4.10.4",
    "build_snapshot": false,
    "build_timestamp": "2015-07-29T09:54:16Z",
    "build_hash": "b88f43fc40b0bcd7f173a1f9ee2e97816de80b19",
    "number": "1.7.1"
  },
  "cluster_name": "es",
  "name": "Bill Foster",
  "status": 200
}
```

Specifically I'm in emacs org mode with babel and [ob-restclient](https://github.com/alf/ob-restclient.el), wanting to parse the resulting json for further use within other code blocks.
